Champ d\xe2\x84\xa2application  membres et employ\xc3\xa9s de la GRC  quorum2.(1) La pr\xc3\xa9sente partie s\xe2\x84\xa2applique aux proc\xc3\xa9dures suivantes :a) la possibilit\xc3\xa9 de se faire entendre ainsi que le demande un membre ou un employ\xc3\xa9 de la GRC;
b) la possibilit\xc3\xa9 de se faire entendre ainsi que le demande un organisme public ou priv\xc3\xa9 ou un
membre du public;
c) les proc\xc3\xa9dures dirig\xc3\xa9es par le Comit\xc3\xa9 de sa propre initiative;
d) une consultation publique dirig\xc3\xa9e par le Comit\xc3\xa9;(2) Le Comit\xc3\xa9 peut autoriser les employ\xc3\xa9s de la GRC \xc3\xa0 participer  ou demander \xc3\xa0 ces derniers departiciper  \xc3\xa0 une proc\xc3\xa9dure en vertu des pr\xc3\xa9sentes r\xc3\xa8gles de la mani\xc3\xa8re qui permettra au Comit\xc3\xa9
de statuer sur l\xe2\x84\xa2affaire de fa\xc3\xa7on \xc3\xa9quitable  simple et rapide  y compris la pr\xc3\xa9sentation des
renseignements et des argumentations oralement ou par \xc3\xa9crit  l\xe2\x84\xa2interrogation des participants et
les r\xc3\xa9ponses aux questions et argumentations(3) Aux fins des proc\xc3\xa9dures devant le Comit\xc3\xa9 en vertu des pr\xc3\xa9sentes r\xc3\xa8gles  le quorum estconstitu\xc3\xa9 par cinq membres du Comit\xc3\xa9.Modification des r\xc3\xa8gles3.(1) Le Comit\xc3\xa9 peut modifier ou compl\xc3\xa9ter les pr\xc3\xa9sentes r\xc3\xa8gles  afin de donner suite \xc3\xa0 une'[ PAGE 1 END ][ PAGE 2 START ] proc\xc3\xa9dure d\xe2\x84\xa2une fa\xc3\xa7on aussi simple et rapide que le permettent les circonstances et l\xe2\x84\xa2\xc3\xa9quit\xc3\xa9.(2) Le Comit\xc3\xa9 donne suite \xc3\xa0 toute question de proc\xc3\xa9dure soulev\xc3\xa9e  non vis\xc3\xa9e par les pr\xc3\xa9sentesr\xc3\xa8gles  de fa\xc3\xa7on aussi simple et rapide que le permettent les circonstances et l\xe2\x84\xa2\xc3\xa9quit\xc3\xa9.Vice de forme ou de proc\xc3\xa9dure4. Un vice de forme ou l\xe2\x84\xa2inobservation d\xe2\x84\xa2une proc\xc3\xa9dure vis\xc3\xa9e dans les pr\xc3\xa9sentes r\xc3\xa8gles quin\xe2\x84\xa2entra\xc3\xaene pas de pr\xc3\xa9judice mat\xc3\xa9riel \xc3\xa0 la personne int\xc3\xa9ress\xc3\xa9e n\xe2\x84\xa2invalide pas une proc\xc3\xa9dure  en tout
ou en partie.Renonciation aux r\xc3\xa8gles5.(1) Les participants peuvent renoncer aux droits proc\xc3\xa9duraux qui leur sont accord\xc3\xa9s dans lespr\xc3\xa9sentes r\xc3\xa8gles.(2) \xc3\x80 d\xc3\xa9faut de preuve contraire  le participant qui omet de se pr\xc3\xa9valoir d\xe2\x84\xa2un droit proc\xc3\xa9duralaccord\xc3\xa9 dans les pr\xc3\xa9sentes r\xc3\xa8gles est r\xc3\xa9put\xc3\xa9 avoir renonc\xc3\xa9 \xc3\xa0 ce droit. D\xc3\xa9lais6. Si les pr\xc3\xa9sentes r\xc3\xa8gles indiquent qu\xe2\x84\xa2un d\xc3\xa9lai doit \xc3\xaatre fix\xc3\xa9 dans une ordonnance ou un avis duComit\xc3\xa9  le d\xc3\xa9lai fix\xc3\xa9 doit pr\xc3\xa9voir le d\xc3\xa9roulement de la proc\xc3\xa9dure de fa\xc3\xa7on aussi simple et rapide
que le permettent les circonstances et l\xe2\x84\xa2\xc3\xa9quit\xc3\xa9.Transmission des documents7.(1) \xc3\x80 moins d\xe2\x84\xa2indication contraire dans les pr\xc3\xa9sentes r\xc3\xa8gles  la remise  l\xe2\x84\xa2exp\xc3\xa9dition  lanotification  la signification ou le d\xc3\xa9p\xc3\xb4t exig\xc3\xa9 ou permis en vertu des pr\xc3\xa9sentes r\xc3\xa8gles peut \xc3\xaatre
effectu\xc3\xa9 de l\xe2\x84\xa2une des fa\xc3\xa7ons suivantes :
a) par porteur  par courrier ordinaire  par courrier recommand\xc3\xa9 ou par service de messagerie;
b) par t\xc3\xa9l\xc3\xa9copieur  si le destinataire dispose des installations n\xc3\xa9cessaires; 
c) par toute autre m\xc3\xa9thode \xc3\xa0 laquelle consent le destinataire.(2) Tout document transmis par t\xc3\xa9l\xc3\xa9copieur doit comprendre les renseignements suivants :a) le nom  l\xe2\x84\xa2adresse  les num\xc3\xa9ros de t\xc3\xa9l\xc3\xa9phone et de t\xc3\xa9l\xc3\xa9copieur de l\xe2\x84\xa2exp\xc3\xa9diteur;
b) la date et l\xe2\x84\xa2heure de la transmission;
c) le nombre total de pages transmises;
d) le nom  l\xe2\x84\xa2adresse et les num\xc3\xa9ros de t\xc3\xa9l\xc3\xa9phone et de t\xc3\xa9l\xc3\xa9copieur du destinataire;
e) le nom  l\xe2\x84\xa2adresse et les num\xc3\xa9ros de t\xc3\xa9l\xc3\xa9phone et de t\xc3\xa9l\xc3\xa9copieur de la personne avec qui
communiquer en cas de probl\xc3\xa8mes de transmission.D\xc3\xa9p\xc3\xb4t des documents8.(1) Sous r\xc3\xa9serve du paragraphe (2)  les documents dont le d\xc3\xa9p\xc3\xb4t est exig\xc3\xa9 en vertu des'[ PAGE 2 END ][ PAGE 3 START ] pr\xc3\xa9sentes r\xc3\xa8gles doivent \xc3\xaatre d\xc3\xa9pos\xc3\xa9s au bureau du pr\xc3\xa9sident.(2) Au cours d\xe2\x84\xa2une proc\xc3\xa9dure  un document peut \xc3\xaatre d\xc3\xa9pos\xc3\xa9 aupr\xc3\xa8s du membre pr\xc3\xa9sidant leComit\xc3\xa9 qui instruit ou examine l\xe2\x84\xa2affaire.(3) \xc3\x80 d\xc3\xa9faut de preuve contraire  la date du d\xc3\xa9p\xc3\xb4t d\xe2\x84\xa2un document est celle de sa r\xc3\xa9ception par leComit\xc3\xa9  telle qu\xe2\x84\xa2elle est indiqu\xc3\xa9e 
a) par la date estampill\xc3\xa9e sur le document par l\xe2\x84\xa2employ\xc3\xa9 du bureau qui fournit un soutien au
Comit\xc3\xa9  dans le cas d\xe2\x84\xa2un document d\xc3\xa9pos\xc3\xa9 conform\xc3\xa9ment \xc3\xa0 l\xe2\x84\xa2alin\xc3\xa9a 7(1)a);
b) par la date qui figure sur la page couverture de la t\xc3\xa9l\xc3\xa9copie imprim\xc3\xa9e par le t\xc3\xa9l\xc3\xa9copieur du
Comit\xc3\xa9  dans le cas d\xe2\x84\xa2un document d\xc3\xa9pos\xc3\xa9 sous forme de t\xc3\xa9l\xc3\xa9copie.Langues officielles9.(1) Sous r\xc3\xa9serve du paragraphe (2)  les documents donn\xc3\xa9s au Comit\xc3\xa9 doivent \xc3\xaatre r\xc3\xa9dig\xc3\xa9s dansau moins l\xe2\x84\xa2une des deux langues officielles. (2) Une personne peut remettre un document dans une autre langue qu\xe2\x84\xa2une des deux languesofficielles  si elle l\xe2\x84\xa2accompagne d\xe2\x84\xa2une traduction dans au moins une des deux langues officielles et
d\xe2\x84\xa2un affidavit attestant la fid\xc3\xa9lit\xc3\xa9 de la traduction.Confidentialit\xc3\xa910 (1) Sous r\xc3\xa9serve du paragraphe (2)  le Comit\xc3\xa9 peut au cours de toute proc\xc3\xa9dure  selon le cas prendre les mesures d\xc3\xa9crites au paragraphe (3) pour prot\xc3\xa9ger les renseignements dans les cas
suivants : 
a) les renseignements ont trait \xc3\xa0 la s\xc3\xa9curit\xc3\xa9 nationale;
b) il s\xe2\x84\xa2agit de renseignements financiers  commerciaux  scientifiques  techniques  personnels ou
autres de nature confidentielle  qui sont trait\xc3\xa9s comme tels de fa\xc3\xa7on constante  et la personne
touch\xc3\xa9e n\xe2\x84\xa2a pas consenti \xc3\xa0 leur divulgation;
c) la divulgation des renseignements risque de mettre en danger la vie  la libert\xc3\xa9 ou la s\xc3\xa9curit\xc3\xa9
d\xe2\x84\xa2une personne;
d) la communication des renseignements risque d\xe2\x84\xa2entraver une enqu\xc3\xaate ou de r\xc3\xa9v\xc3\xa9ler des
techniques d\xe2\x84\xa2enqu\xc3\xaate.(2) Le Comit\xc3\xa9 peut prendre les mesures mentionn\xc3\xa9es au paragraphe (3) dans les conditionssuivantes :
a) la protection des renseignements l\xe2\x84\xa2emporte sur leur consultation et leur divulgation dans
l\xe2\x84\xa2int\xc3\xa9r\xc3\xaat public;
b) les mesures sont con\xc3\xa7ues de fa\xc3\xa7on \xc3\xa0 ne pas nuire \xc3\xa0 la nature publique de la proc\xc3\xa9dure sauf dans
la mesure n\xc3\xa9cessaire pour prot\xc3\xa9ger ad\xc3\xa9quatement les renseignements.(3) Le Comit\xc3\xa9 peut notamment exiger :a) que la proc\xc3\xa9dure en tout ou en partie se d\xc3\xa9roule \xc3\xa0 huis clos  en pr\xc3\xa9sence des participants
uniquement  \xc3\xa0 l\xe2\x84\xa2exclusion de tout membre du public;'[ PAGE 3 END ][ PAGE 4 START ] b) que la publication de l\xe2\x84\xa2information donn\xc3\xa9e au Comit\xc3\xa9 soit limit\xc3\xa9e ou interdite;c) que la divulgation de l\xe2\x84\xa2information que donne ou re\xc3\xa7oit le Comit\xc3\xa9 soit interdite ou limit\xc3\xa9e \xc3\xa0
certains ou \xc3\xa0 tous les participants.Invitations11.(1) Dans le cas d\xe2\x84\xa2une consultation publique effectu\xc3\xa9e par le Comit\xc3\xa9  un participant peutdemander au Comit\xc3\xa9 d\xe2\x84\xa2\xc3\xaatre invit\xc3\xa9 en pr\xc3\xa9sentant une demande par \xc3\xa9crit avant le d\xc3\xa9but de la
proc\xc3\xa9dure ou une demande orale au cours de la proc\xc3\xa9dure  mais dans tous les cas d\xc3\xa8s que le
participant prend connaissance des circonstances donnant lieu \xc3\xa0 la demande.(2) La demande d\xe2\x84\xa2invitation doit pr\xc3\xa9ciser ce qui suit :a) les motifs de l\xe2\x84\xa2invitation;
b) la pertinence entre l\xe2\x84\xa2affaire et l\xe2\x84\xa2information  le dossier ou la chose qu\xe2\x84\xa2apporte l\xe2\x84\xa2invit\xc3\xa9;
c) la raison pour laquelle l\xe2\x84\xa2invit\xc3\xa9 est la personne comp\xc3\xa9tente \xc3\xa0 apporter l\xe2\x84\xa2information  le dossier
ou la chose.(3) L\xe2\x84\xa2invitation doit \xc3\xaatre remise directement \xc3\xa0 l\xe2\x84\xa2invit\xc3\xa9 au moins sept jours avant la date de saparticipation \xc3\xa0 la consultation publique.(4) Si une consultation publique est ajourn\xc3\xa9e sans que la date de sa reprise soit annonc\xc3\xa9e  leComit\xc3\xa9 doit informer toutes les personnes qu\xe2\x84\xa2il a invit\xc3\xa9es de la date de sa reprise :
a) soit au moins cinq jours avant la date \xc3\xa0 laquelle la personne doit se repr\xc3\xa9senter; 
b) soit dans un d\xc3\xa9lai juste et raisonnable dans les circonstances   si le Comit\xc3\xa9 donne un pr\xc3\xa9avis de
moins de cinq jours de la date de reprise.Ajournements12. Le Comit\xc3\xa9 peut  \xc3\xa0 la demande d\xe2\x84\xa2un participant ou de sa propre initiative  ajourner uneproc\xc3\xa9dure  aux conditions que le Comit\xc3\xa9 juge n\xc3\xa9cessaires pour assurer un examen rapide  simple
et \xc3\xa9quitable de l\xe2\x84\xa2affaire.Tenue des dossiers13.(1) Le Comit\xc3\xa9 doit tenir un dossier de ce qui suit relativement \xc3\xa0 chaque proc\xc3\xa9dure :a) les documents qui ont amorc\xc3\xa9 la proc\xc3\xa9dure;
b) les pr\xc3\xa9avis donn\xc3\xa9s par le Comit\xc3\xa9;
c) les preuves documentaires  argumentations \xc3\xa9crites ou autres documents d\xc3\xa9pos\xc3\xa9s aupr\xc3\xa8s du
Comit\xc3\xa9;
d) la d\xc3\xa9cision finale du Comit\xc3\xa9;
e) la transcription de la proc\xc3\xa9dure consign\xc3\xa9e par le Comit\xc3\xa9;
f) les renseignements pertinents que le Comit\xc3\xa9 ordonne de verser au dossier.(2) Sous r\xc3\xa9serve de toute mesure prise en vertu de la r\xc3\xa8gle 10  le dossier pr\xc3\xa9vu au paragraphe (1)doit \xc3\xaatre accessible aux participants et au public.'[ PAGE 4 END ]
